import React from 'react';
import MainHeader from './components/MainHeader';
import './style.scss';

const Home = ({user}) => {

  return (
    <>
      <MainHeader user={user}/>
      <section id="home-page-screen-container">
        <div class="sub-home-page-container">
          
        </div>
      </section>
    </>
  )
}

export default Home;
